import React from 'react';
import Nav from "../components/main/Nav";
import SignUpBox from "../components/main/SignUpBox";

const Index = () => {
    const styles = {
        main: {
            display: 'flex',
            width: '100%'
        }
    }

    return (
        <div>
          <Nav />
          <div style={styles.main}>
              <SignUpBox />
          </div>
        </div>
    );
};

export default Index;
